import Axios from 'axios'

export const getPost = async (id) => {
    console.log(id)

    try {
        Axios.get(`https://jsonplaceholder.typicode.com/posts/${id}`)
            .then((res) => {
                setTitle(res.data.title)
                setBody(res.data.body)

                console.log(res.data);
            })
            .catch(err => {
                setTitle("No existe el post")
                console.log(err)
            })
    }
    catch(err) {
        console.log(err)
    }
}
